	CLOSE cursor_a ;
	
	SET done = 0;
	SET aview = -1;
	OPEN cursor_aaaa;
	REPEAT
		IF NOT done THEN
			FETCH cursor_aaaa INTO aname, aview;
			IF aview!=-1 THEN
				IF n_rop != 0 THEN
					CALL add_snd_req('dns', tbl_to_dnstype('aaaa_record'), aview, aname, 0, 2);
				end if;
				SELECT aname, aview, 'aaaa_record';
				SET aview=-1;
			END IF;
		END IF;
	UNTIL done END REPEAT;
	CLOSE cursor_aaaa;
	
	SET done = 0;
	SET aview = -1;
	OPEN cursor_cname;
	REPEAT
		IF NOT done THEN
			FETCH cursor_cname INTO aname, aview;
			IF aview!=-1 THEN
				IF n_rop != 0 THEN
					CALL add_snd_req('dns', tbl_to_dnstype('cname_record'), aview, aname, 0, 2);
				end if;				
				SELECT aname, aview, 'cname_record';
				SET aview=-1;
			END IF;
		END IF;
	UNTIL done END REPEAT;
	CLOSE cursor_cname;
	
	SET done = 0;
	SET aview = -1;
	OPEN cursor_mx;
	REPEAT
		IF NOT done THEN
			FETCH cursor_mx INTO aname, aview;
			IF aview!=-1 THEN
				IF n_rop != 0 THEN
					CALL add_snd_req('dns', tbl_to_dnstype('mx_record'), aview, aname, 0, 2);
				end if;
				SELECT aname, aview, 'mx_record';
				SET aview=-1;
			END IF;
		END IF;
	UNTIL done END REPEAT;
	CLOSE cursor_mx;
	
	SET done = 0;
	SET aview = -1;
	OPEN cursor_ns;
	REPEAT
		IF NOT done THEN
			FETCH cursor_ns INTO aname, aview;
			IF aview!=-1 THEN
				IF n_rop != 0 THEN
					CALL add_snd_req('dns', tbl_to_dnstype('ns_record'), aview, aname, 0, 2);
				end if;
				SELECT aname, aview, 'ns_record';
				SET aview=-1;
			END IF;
		END IF;
	UNTIL done END REPEAT;
	CLOSE cursor_ns;
	
	SET done = 0;
	SET aview = -1;
	OPEN cursor_txt;
	REPEAT
		IF NOT done THEN
			FETCH cursor_txt INTO aname, aview;
			IF aview!=-1 THEN
				IF n_rop != 0 THEN
					CALL add_snd_req('dns', tbl_to_dnstype('txt_record'), aview, aname, 0, 2);
				end if;
				SELECT aname, aview, 'txt_record';
				SET aview=-1;
			END IF;
		END IF;
	UNTIL done END REPEAT;
	CLOSE cursor_txt;
	
	SET done = 0;
	SET n_zid = -1;
	OPEN cursor_zone;
	REPEAT
		IF NOT done THEN
			FETCH cursor_zone INTO n_zid;
			IF n_zid!=-1 THEN
				SET i=1;  
				WHILE i <= 6 DO
					SET cut_tbl=CONCAT(SUBSTRING_INDEX(SUBSTRING_INDEX(arr_tbls, ',' ,i),',',-1));
					
					SET @sqlcmd=CONCAT("update `", cut_tbl, "` set `enable`=", n_goodop, " WHERE `zone`=", n_zid);
					PREPARE stmt FROM @sqlcmd;
					EXECUTE stmt;
					DEALLOCATE PREPARE stmt; 
					SET i = i + 1;
				END WHILE;
			SET n_zid=-1;
			END IF;
		END IF;
	UNTIL done END REPEAT;
	CLOSE cursor_zone;
	
    END */$$
